void test_longestCommonPrefix(){
    vector<string> vec1{"flower","flow","flight"},
        vec2{"dog","racecar","car"}, vec3{"abca", "abc"}, 
        vec4{"aaa","aa","aaa"};
    cout << longestCommonPrefix(vec1) << endl;
    cout << longestCommonPrefix(vec2) << endl;
    cout << longestCommonPrefix(vec3) << endl;
    cout << longestCommonPrefix(vec4) << endl;
}


